import React, { Component } from 'react';
import '../css/Home.css';

const HOMETEXT = "Hello, I’m a JavaScript Developer.";
let HOMETEXT_len = HOMETEXT.length;
let index = 0;
let TEXTSTATE = true;
let home_text = "";

const HometextDynamic =  setInterval(() => {
    if(index === HOMETEXT_len){
        TEXTSTATE = false;
    }
    else if(index === -1){
        TEXTSTATE = true;
        index++;
    }

    if(TEXTSTATE){
        home_text += HOMETEXT[index++];
    }
    else{
        home_text = home_text.substr(0, --index);
    }
}, 300)

type HomeProps = {
    name: string;
  };

const Home: React.FC<HomeProps> = ({ name }) => (

    <div id="home">
        <span>{name}</span>
    </div>
  );

